import './index.css';
import Image from './components/Image';
import UploadIcon from './img/upload.svg'

function App() {
  return (
    <div className="App">
      <button class="upload-button">
        <img src={UploadIcon} alt="upload icon"/>Add new Image
      </button>
      <Image/>
    </div>
  );
}

export default App;
